import React, { Component } from 'react';
import classNames from 'classnames';

export default class Chef extends Component {

    render(){
        const { profileUrl, name, title, comment, url, className } = this.props;
        const wrapperCls = classNames( 'chef-container flex-container-col', className );

        return (

            <div className={wrapperCls}>
                <div className="flex-container-profile flex-item-col">
                    <div className="flex-item-profile align">
                        <img className="profile-pic" src={profileUrl} alt={name} width="200" height="200"/>
                    </div>
                    <div className="flex-container-col flex-item-profile align">
                        <h2 className="list-title">{name}</h2>
                        <h3 className="list-subtitle">{title}</h3>
                    </div>

                </div>
                <div className="comment-container flex-item-col">
                    <h2 className="h2">
                        {comment}
                    </h2>

                </div>
                <div className="pic-container flex-item-col" width="400" height="400">
                    <img src={url} alt={comment} />
                </div>
            </div>
        );
    }
}
